import React from 'react'
import { NavLink } from 'react-router-dom';
import './style.css'

const Nav = () => {
  return (
    <>
      <nav style={nav}>
        <NavLink to='/' style={{marginRight:"35vh"}}><h1>Connect <span style={{ color: "blue" }}>ING</span></h1>
        </NavLink>
        <NavLink to='/feed'> Feed </NavLink>
        <NavLink to='/sign'> Sign </NavLink>
        <NavLink to='/login'>LogIn</NavLink>
      </nav>
    </>
  )
}

export default Nav;

const nav = {
  width:"80%",
  margin:"auto",
  display: "flex",
  justifyContent: "space-around",
}
